import axios from 'axios';
const API_URL = 'https://free.currconv.com/api/v7/';
const access_key = "8f00ec6afddcb8d95da8";

export default async function makeRequest(from, to) {
    const response = await axios.get(`${API_URL}convert?q=${from}_${to}&compact=ultra&apiKey=${access_key}`,
            //{ headers: { 'Content-Type': 'application/json' } }
            )
    return (response.data)
}
